### YamlMime:TSEnum
name: Excel.CalcErrorCellValueSubType
uid: 'office!Excel.CalcErrorCellValueSubType:enum'
package: office!
fullName: Excel.CalcErrorCellValueSubType
summary: 'Represents types of \#CALC! errors.'
remarks: '\[ [API set: ExcelApi 1.16](/javascript/api/requirement-sets/excel/excel-api-requirement-sets) \]'
isPreview: false
isDeprecated: false
fields:
  - name: arrayOfArrays
    uid: 'office!Excel.CalcErrorCellValueSubType.arrayOfArrays:member'
    package: office!
    summary: 'An error caused by including an array in an array. Displays as error type \#CALC! in Excel.'
    value: '"ArrayOfArrays"'
  - name: arrayOfRanges
    uid: 'office!Excel.CalcErrorCellValueSubType.arrayOfRanges:member'
    package: office!
    summary: 'An error caused by including a range in an array. Displays as error type \#CALC! in Excel.'
    value: '"ArrayOfRanges"'
  - name: dataTableReferencedPendingFormula
    uid: 'office!Excel.CalcErrorCellValueSubType.dataTableReferencedPendingFormula:member'
    package: office!
    summary: >-
      An error caused by a data table referencing a pending formula. The pending formula is likely asynchronous.
      Displays as error type \#CALC! in Excel.
    value: '"DataTableReferencedPendingFormula"'
  - name: emptyArray
    uid: 'office!Excel.CalcErrorCellValueSubType.emptyArray:member'
    package: office!
    summary: 'An error caused by an empty array. Displays as error type \#CALC! in Excel.'
    value: '"EmptyArray"'
  - name: lambdaInCell
    uid: 'office!Excel.CalcErrorCellValueSubType.lambdaInCell:member'
    package: office!
    summary: 'An error caused by a cell''s formula evaluating to a lambda value. Displays as error type \#CALC! in Excel.'
    value: '"LambdaInCell"'
  - name: textOverflow
    uid: 'office!Excel.CalcErrorCellValueSubType.textOverflow:member'
    package: office!
    summary: >-
      An error caused by a cell's formula returning a string that exceeds the maximum of 32767 characters. Displays as
      error type \#CALC! in Excel. Some characters, like emoji, may appear to be one character in the Excel UI but are
      actually processed as surrogate characters. A surrogate character counts as multiple characters toward the maximum
      character limit.
    value: '"TextOverflow"'
  - name: tooDeeplyNested
    uid: 'office!Excel.CalcErrorCellValueSubType.tooDeeplyNested:member'
    package: office!
    summary: >-
      An error caused by a `CellValue` object that is too deeply nested within another `CellValue`<!-- -->. Displays as
      error type \#CALC! in Excel.
    value: '"TooDeeplyNested"'
  - name: tooManyCells
    uid: 'office!Excel.CalcErrorCellValueSubType.tooManyCells:member'
    package: office!
    summary: 'An error caused by a function referencing too many cells. Displays as error type \#CALC! in Excel.'
    value: '"TooManyCells"'
  - name: unknown
    uid: 'office!Excel.CalcErrorCellValueSubType.unknown:member'
    package: office!
    summary: 'An unknown type of error. Displays as error type \#CALC! in Excel.'
    value: '"Unknown"'
  - name: unsupportedLifting
    uid: 'office!Excel.CalcErrorCellValueSubType.unsupportedLifting:member'
    package: office!
    summary: >-
      An error caused by attempting to lift an unsupported formula (such as a Dynamic UDF) over an array. Displays as
      error type \#CALC! in Excel.
    value: '"UnsupportedLifting"'
